import React from "react";
import Header from "./Components/Header/Header";
import styled from "styled-components";
import bgImage from "./images/background.jpeg";

let BackgroundImage = styled.div`
	background-image: "./images/background.jpeg";
	height: 100vh;
`;

function App() {
	return (
		<BackgroundImage>
			<Header />
		</BackgroundImage>
	);
}

export default App;
